import React, { Fragment } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import headerBg from "../../img/home/header_bg.png";
import Box from "@material-ui/core/Box";
import Paper from "@material-ui/core/Paper";
import headerImg from "../../img/home/doctors-heart.png";
import { Typography } from "@material-ui/core";
import SearchTabs from "./SearchTabs";
import Location from "./Location";
import SearchIcon from "@material-ui/icons/Search";
import Button from "@material-ui/core/Button";
import IconButton from "@material-ui/core/IconButton";
import problemImg from "../../img/home/problem.svg";
import Divider from "@material-ui/core/Divider";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  divider: {
    marginTop: 20,
    height: 6,
    width: 80,
    backgroundColor: "#FF8686",
    justifyContent: "center",
  },

  problemImg: {
    marginLeft: 20,
    marginRight: 20,
    width: "80%",
    height: "80%",
  },
}));

export default function Header() {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <div className={classes.root}>
        <Box
          display="flex"
          flexDirection="column"
          alignItems="center"
          justifyContent="center"
        >
          <Divider className={classes.divider} />
          <br></br>
          <Typography variant="h4" color="primary" align="center">
            Problem
          </Typography>
        </Box>
        <Grid container spacing={0} className={classes.grid}>
          <Grid item xs={11} sm={6} className={classes.leftGrid}>
            <img
              src={problemImg}
              alt="problemImg"
              className={classes.problemImg}
            />
          </Grid>

          <Grid item xs={12} sm={6} className={classes.rightGrid}>
            <Box
              display="flex"
              flexDirection="column"
              alignItems="center"
              justifyContent="center"
            >
              <Box>
                <Typography variant="h5" color="primary">
                  Information about doctors are scattered in Malaysia
                </Typography>
              </Box>
              <Box>
                {" "}
                <Typography variant="body">
                  The current ways of getting doctor information are mainly
                  through word-of-mouth or searching through individual
                  healthcare institution’s website. This creates an information
                  gap between doctors and patients in Malaysia.
                </Typography>
              </Box>
            </Box>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}
